CREATE TABLE `produtos` (
  `id_produto` int NOT NULL AUTO_INCREMENT,
  `id_anunciante` int DEFAULT NULL,
  `codigo` varchar(45) DEFAULT NULL,
  `codigoBarras` varchar(45) DEFAULT NULL,
  `nome` varchar(245) DEFAULT NULL,
  `descricao` text,
  `marca` varchar(245) DEFAULT NULL,
  `procedencia` varchar(45) DEFAULT NULL,
  `peso` varchar(45) DEFAULT NULL,
  `altura` varchar(45) DEFAULT NULL,
  `largura` varchar(45) DEFAULT NULL,
  `comprimento` varchar(45) DEFAULT NULL,
  `preco` varchar(45) DEFAULT NULL,
  `cfop` varchar(45) DEFAULT NULL,
  `cst` varchar(45) DEFAULT NULL,
  `icms` varchar(45) DEFAULT NULL,
  `estoque` varchar(45) DEFAULT NULL,
  `embalagem` varchar(45) DEFAULT NULL,
  `referencia` varchar(45) DEFAULT NULL,
  `ncm` varchar(45) DEFAULT NULL,
  `lista` varchar(245) DEFAULT NULL,
  `infAdicionais` text,
  `origem` varchar(45) DEFAULT NULL,
  `origemDescricao` varchar(45) DEFAULT NULL,
  `dataAlteracaoImagem` varchar(45) DEFAULT NULL,
  `foto` text,
  `contador_procurado` int DEFAULT '0',
  `contador_destaque` int DEFAULT '0',
  PRIMARY KEY (`id_produto`),
  KEY `id_anunciante` (`id_anunciante`)
) ENGINE=InnoDB AUTO_INCREMENT=5005 DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_0900_ai_ci;
